import { Component } from '@angular/core';
import { FormGroup, FormBuilder, Validators } from '@angular/forms';
import { Router } from '@angular/router';
import { HttpClient } from '@angular/common/http';
import { NumberValidators } from '../shared/number.validator';

@Component({
  selector: 'app-signup-page',
  templateUrl: './signup-page.component.html',
  styleUrls: ['./signup-page.component.css']
})
export class SignupPageComponent {
  public signUpForm!: FormGroup;

  constructor(private formBuilder: FormBuilder, private http: HttpClient, private router: Router) {}

  ngOnInit(): void {
    this.signUpForm = this.formBuilder.group({
      fname: ["", Validators.required],
      phone: ["", Validators.required, Validators.number],
      email: ["", [Validators.required, Validators.email]],
      password: ["", [Validators.required, Validators.minLength(5)]]
    });
  }

  signUp() {
    if (this.signUpForm.valid) {
      console.log(this.signUpForm.value);
      this.http.post<any>("http://localhost:3000/signupUsersList", this.signUpForm.value).subscribe({
        next: (res) => {
          alert('Sign Up Successful');
          this.signUpForm.reset();
          this.router.navigate(["login"]);
        },
        error: (err) => {
          alert("Something went wrong");
        }
      });
    } else {
      alert("Please enter all the required values.");
    }
  }
}

<div class="container">
  <form [formGroup]="signUpForm" (ngSubmit)="signUp()" class="form-box1">
    <h3>SignUp</h3>

    <div class="form-group">
      <label for="fname">Full Name</label>
      <input type="text" formControlName="fname" class="form-control mb-3 mt-3" placeholder="Enter Full Name" />
      <div style="color:red;font-size: smaller;" *ngIf="signUpForm.get('fname')?.hasError('required') && signUpForm.get('fname')?.touched" class="error-message">
        Full Name is required.
      </div>
    </div>

    <div class="form-group">
      <label for="phone">Phone Number</label>
      <input type="text" formControlName="phone" class="form-control mb-3 mt-3" placeholder="Enter Phone Number" />
      <div style="color:red;font-size: smaller;" *ngIf="signUpForm.get('phone')?.hasError('required') && signUpForm.get('phone')?.touched" class="error-message">
        Phone Number is required.
      </div>
      <div style="color:red;font-size: smaller;" *ngIf="signUpForm.get('phone')?.hasError('number') && signUpForm.get('email')?.touched" class="error-message">
        Invalid email format.
      </div>
    </div>

    <div class="form-group">
      <label for="email">Email</label>
      <input type="email" formControlName="email" class="form-control mb-3 mt-3" placeholder="Enter Email" />
      <div style="color:red;font-size: smaller;" *ngIf="signUpForm.get('email')?.hasError('required') && signUpForm.get('email')?.touched" class="error-message">
        Email is required.
      </div>
      <div style="color:red;font-size: smaller;" *ngIf="signUpForm.get('email')?.hasError('email') && signUpForm.get('email')?.touched" class="error-message">
        Invalid email format.
      </div>
    </div>

    <div class="form-group">
      <label for="password">Password</label>
      <input type="password" formControlName="password" class="form-control mb-3 mt-3" placeholder="Enter Password" />
      <div style="color:red;font-size: smaller;" *ngIf="signUpForm.get('password')?.hasError('required') && signUpForm.get('password')?.touched" class="error-message">
        Password is required.
      </div>
      <div style="color:red;font-size: smaller;" *ngIf="signUpForm.get('password')?.hasError('minlength') && signUpForm.get('password')?.touched" class="error-message">
        Password must be at least 5 characters long.
      </div>
    </div>

    <span>Already have an account? </span>
    <a routerLink="/login">Sign In</a>
    <br />
    <button type="submit" class="btn btn-success">Signup</button>
  </form>
</div>
<router-outlet></router-outlet>
